import React, { useState } from "react";
import { motion } from "framer-motion";
import { Send, Loader2, Bot, User } from "lucide-react";
import "katex/dist/katex.min.css";
import { BlockMath, InlineMath } from "react-katex";

function renderMath(text) {
  // Render LaTeX if wrapped in $...$
  const parts = text.split(/(\$.*?\$)/g);
  return parts.map((part, i) => {
    if (part.startsWith("$") && part.endsWith("$")) {
      return <InlineMath key={i}>{part.slice(1, -1)}</InlineMath>;
    }
    return <span key={i}>{part}</span>;
  });
}

function App() {
  const [question, setQuestion] = useState("");
  const [messages, setMessages] = useState([]);
  const [loading, setLoading] = useState(false);

  const handleSubmit = async () => {
    if (!question.trim()) return;

    const newMessages = [
      ...messages,
      { type: "user", text: question, id: Date.now() },
    ];
    setMessages(newMessages);
    setQuestion("");
    setLoading(true);

    try {
      const res = await fetch("http://localhost:8000/solve", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ user_id: "demo", question }),
      });

      const data = await res.json();
      setMessages([
        ...newMessages,
        {
          type: "bot",
          text: data.error
            ? `❌ ${data.error}`
            : data.answer || "No answer provided",
          id: Date.now() + 1,
        },
      ]);
    } catch (error) {
      setMessages([
        ...newMessages,
        { type: "bot", text: `❌ ${error.message}`, id: Date.now() + 1 },
      ]);
    }

    setLoading(false);
  };

  return (
    <div className="flex flex-col h-screen bg-gradient-to-br from-pink-200 via-indigo-100 to-blue-200">
      {/* Header */}
      <motion.div
        initial={{ y: -40, opacity: 0 }}
        animate={{ y: 0, opacity: 1 }}
        className="p-6 text-center backdrop-blur-md bg-white/40 shadow-lg"
      >
        <h1 className="text-4xl font-extrabold bg-gradient-to-r from-indigo-600 via-purple-600 to-pink-600 bg-clip-text text-transparent">
          Math AI Tutor
        </h1>
        <p className="text-gray-700 font-medium">
          Ask me any math problem ✨
        </p>
      </motion.div>

      {/* Chat Area */}
      <div className="flex-1 overflow-y-auto p-6 space-y-5">
        {messages.map((msg) => (
          <motion.div
            key={msg.id}
            initial={{ opacity: 0, y: 15 }}
            animate={{ opacity: 1, y: 0 }}
            className={`flex items-start gap-3 ${
              msg.type === "user" ? "justify-end" : "justify-start"
            }`}
          >
            {msg.type === "bot" && (
              <div className="p-2 bg-gradient-to-br from-indigo-400 to-purple-500 rounded-full shadow-md">
                <Bot className="w-5 h-5 text-white" />
              </div>
            )}

            <div
              className={`p-4 rounded-2xl max-w-lg shadow-lg backdrop-blur-sm ${
                msg.type === "user"
                  ? "bg-gradient-to-br from-pink-500 to-red-400 text-white"
                  : "bg-white/80 border border-indigo-100 text-gray-900"
              }`}
            >
              {renderMath(msg.text)}
            </div>

            {msg.type === "user" && (
              <div className="p-2 bg-gradient-to-br from-pink-500 to-red-500 rounded-full shadow-md">
                <User className="w-5 h-5 text-white" />
              </div>
            )}
          </motion.div>
        ))}

        {loading && (
          <motion.div
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            className="flex items-center gap-2 text-indigo-600 font-medium"
          >
            <Loader2 className="w-5 h-5 animate-spin" />
            Thinking...
          </motion.div>
        )}
      </div>

      {/* Input Area */}
      <div className="p-4 bg-white/60 backdrop-blur-md shadow-lg">
        <div className="flex items-center gap-3">
          <textarea
            value={question}
            onChange={(e) => setQuestion(e.target.value)}
            placeholder="Type your math question with LaTeX ($x^2+3x+2=0$)..."
            rows={1}
            className="flex-1 resize-none border border-indigo-200 rounded-xl p-3 focus:ring-2 focus:ring-pink-400 outline-none shadow-sm"
          />
          <button
            onClick={handleSubmit}
            disabled={loading || !question.trim()}
            className="p-3 bg-gradient-to-br from-indigo-500 to-purple-600 text-white rounded-xl shadow-lg hover:scale-105 transition-transform"
          >
            {loading ? <Loader2 className="w-5 h-5 animate-spin" /> : <Send />}
          </button>
        </div>
      </div>
    </div>
  );
}

export default App;
